import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// Importando as páginas
import Home from './src/Pages/Home';
import RewardsPage from './src/Pages/RewardsPage';
import Navbar from 'frontend/src/components/Navbar.js'; // Caminho corrigido
import History from './src/Pages/History';
import GerencieViagem from './src/Pages/GerencieViagem';
import Beneficios from './src/Pages/Beneficios';

function App() {
  return (
    <>
      <Router>
        <header>
          <Navbar /> {/* Corrigido para um componente React válido */}
        </header>
        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/rewards" element={<RewardsPage />} />
            <Route path="/benefitis" element={<Beneficios />} />
            <Route path="/history" element={<History />} />
            <Route path="/inicarViagem" element={<GerencieViagem />} />
          </Routes>
        </main>
      </Router>
    </>
  );
}

export default App;
